import logo from './logo.svg';
import './App.css';
import Main from './layouts/Main';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


function App() {
  return (
    <>
      <Router>

        <Routes>
          <Route path="/" exact>
              <Main />
            </Route>
        </Routes>


      </Router>


    </>
  );
}

export default App;
